/*
 * parse_m2uaMIB(): parses .conf file entries needed to configure the mib.
 */
void
parse_m2uaMIB(const char *token, char *line)
{
	size_t tmpsize;
	struct m2uaMIB_data *StorageTmp = SNMP_MALLOC_STRUCT(m2uaMIB_data);

	DEBUGMSGTL(("m2uaMIB", "parsing config...  "));
	if (StorageTmp == NULL) {
		config_perror("malloc failure");
		return;
	}
	line = read_config_read_data(ASN_UNSIGNED, line, &StorageTmp->m2uaAsNextIndex, &tmpsize);
	line = read_config_read_data(ASN_UNSIGNED, line, &StorageTmp->m2uaIfNextIndex, &tmpsize);
	line = read_config_read_data(ASN_UNSIGNED, line, &StorageTmp->m2uaAspNextIndex, &tmpsize);
	line = read_config_read_data(ASN_UNSIGNED, line, &StorageTmp->m2uaSgNextIndex, &tmpsize);
	m2uaMIB_add(StorageTmp);
	(void) tmpsize;
	DEBUGMSGTL(("m2uaMIB", "done.\n"));
}

